import React from "react";
import '../App.css';

import Todo from "../components/Todo";


const Todos = (props) =>{

    const clickRemoveTodo = () =>{
        props.clickRemoveTodo(todo.id);
    }

    return (
       <div className="todos_wrapper">
        <ul className="todos">
        {props.todos.map((todo) => (
          
          <Todo todo={todo} key={todo.id} clickRemoveTodo = {clickRemoveTodo}/>

        ))}
        </ul>
       </div>

    )
}

export default Todos;
